import './styles.css';

export const LayoutComponents = (props) => {
	return (
		<div className="container">
			<div className="container-login">
				<div className="wrap-login">
					{props.children}
				</div>
			</div>
		</div>
	)
}


export const tooltip = (text, icon) => {
	return (
		<div className='warning'>
			<span className='message'>{text}</span>
			<i className={icon}></i>
		</div>
	)
}
